describe("Test helpers",function(){describe("normalizeKeyAliases",function(){it("Should convert some hotkeys to normal",function(){var e={"cmd+ alt+s":"alt+meta+s","cmd++":"++meta","ctrl+ alt+s":"alt+control+s"," command+s":"meta+s","alt+s+ctrl":"alt+control+s","shift+ctrl+cmd+D":"control+d+meta+shift","meta+windows+win+ctrl+cmd":"control+meta","cmd+ alt+ shift ":"alt+meta+shift","return + esc ":"enter+escape"};Object.keys(e).forEach(function(t){expect(e[t]).to.be.equal(Jodit.modules.Helpers.normalizeKeyAliases(t))})})}),describe("isInt",function(){it("Should check value is int or not",function(){for(var e=["cmd+ alt+s",!1,"+1",!0,"-1",!0,"-1dddd",!1,"10",!0,"10.1",!1,"10e10",!0,"10e10",!0,10,!0,11.33,!1],t=0;t<e.length;t+=2)expect(e[t+1]).to.be.equal(Jodit.modules.Helpers.isInt(e[t]))})}),describe("isNumeric",function(){it("Should check value is int or not",function(){for(var e=["cmd+ alt+s",!1,"+1",!0,"-1",!0,"-1000.333",!0,"-1dddd",!1,"s1999999",!1," -1 ",!1,"10",!0,"10.1",!0,"12312310.1243234",!0,"10e10",!0,"10e10",!0,10,!0,11.33,!0],t=0;t<e.length;t+=2)expect(e[t+1]).to.be.equal(Jodit.modules.Helpers.isNumeric(e[t]))})})});